const Todo = ({todo, handleToggle, completeTodo}) => {

  const handleClick = e => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  };

  return (
      <div id={todo.id} onClick={handleClick} className={todo.complete ? "todo strike" : "todo"}>
        <p>{todo.task}</p>
        <div>
          <button >
            Complete
          </button>
        </div>
      </div>
  );
};

export default Todo;
